ga6z(){return"Petra is a brilliant display of man\u2019s artistry in turning barren rock into a majestic wonder."},
ga6A(){return"Edward Dawson"},
ga6n(){return"They were particularly skillful in harvesting rainwater, agriculture and stone carving."},
ga6o(){return"Perhaps a more prominent resemblance to Hellenistic style in Petra comes with its Treasury."},
ga6E(){return"\u201cStunning Stone Monuments of Petra | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga6v(){return"Map showing location of Petra in Ma\u2019an Governorate, Jordan."},
ga6r(){return"The area around Petra has been inhabited from as early as 7000  BCE, and the Nabataeans might have settled in what would become the capital city of their kingdom as early as the 4th century BCE.\nThe trading business gained the Nabataeans considerable revenue and Petra became the focus of their wealth. The Nabataeans were accustomed to living in the barren deserts, unlike their enemies, and were able to repel attacks by taking advantage of the area's mountainous terrain."},
ga6s(){return"Petra flourished in the 1st century CE, when its famous Al-Khazneh structure - believed to be the mausoleum of Nabataean king Aretas IV - was constructed, and its population peaked at an estimated 20,000 inhabitants.\nAccess to the city is through a 3/4 mile-long (1.2 km) gorge called the Siq, which leads directly to the Khazneh."},
ga6p(){return'Famous for its rock-cut architecture and water conduit system, Petra is also called the "Red Rose City" because of the color of the stone from which it is carved.\nAnother thing Petra is known for is its Hellenistic (\u201cGreek\u201d) architecture. These influences can be seen in many of the facades at Petra and are a reflection of the cultures that the Nabataens traded with.'},
ga6q(){return"The facade of the Treasury features a broken pediment with a central tholos (\u201cdome\u201d) inside, and two obelisks appear to form into the rock of Petra at the top. Near the bottom of the Treasury we see twin Greek Gods: Pollux, Castor, and Dioscuri, who protect travelers on their journeys. \nNear the top of the Treasury, two victories are seen standing on each side of a female figure on the tholos. This female figure is believed to be the Isis-Tyche, Isis being the Egyptian Goddess and Tyche being the Greek Goddess of good fortune."},
ga6t(){return"Petra is located in southern Jordan. It is adjacent to the mountain of Jabal Al-Madbah, in a basin surrounded by mountains forming the eastern flank of the Arabah valley running from the Dead Sea to the Gulf of Aqaba."},
ga6u(){return"The area around Petra has been inhabited from as early as 7000 BC, and the Nabataeans might have settled in what would become the capital city of their kingdom as early as the 4th century BC.\nArchaeological work has only discovered evidence of Nabataean presence dating back to the second century BC, by which time Petra had become their capital. The Nabataeans were nomadic Arabs who invested in Petra's proximity to the incense trade routes by establishing it as a major regional trading hub."},
ga6g(){return"First Edomites occupied the area and established a foothold."},
ga6f(){return"Became part of the Roman province Arabia"},
ga6k(){return"After being damaged by earthquakes, habitation of the city all but ceased."},
ga6h(){return"Rediscovered by the Swiss traveler Johann Ludwig Burckhardt."},
ga6i(){return"Excavations led on the site by the British School of Archaeology and the American Center of Oriental Research."},
ga6j(){return"Appeared in the film Indiana Jones and The Last Crusade."},
ga7o(){return"Pyramids of Giza"},
ga7n(){return"The ancient wonder"},
ga7m(){return"Cairo, Egypt"},
ga77(){return"Egyptian"},
ga78(){return"Egypt"},
ga7j(){return"The Tallest Structures on Earth"},
ga7i(){return"Until the Advent of Modern Skyscrapers"},
ga7k(){return"From the heights of these pyramids, forty centuries look down on us."},
ga7l(){return"Napoleon Bonaparte"},
ga79(){return"It is theorized the pyramid not only served as a tomb for the pharaoh, but also as a storage pit for various items he would need in the afterlife."},
ga7a(){return"The Great Pyramid consists of an estimated 2.3 million blocks. Approximately 5.5 million tonnes of limestone, 8,000 tonnes of granite, and 500,000 tonnes of mortar were used in the construction."},
ga7p(){return"\u201cThe Great Pyramids of Giza | Egypt\u2019s Ancient Mysteries | National Geographic UK.\u201d Youtube, uploaded by National Geographic UK."},
ga7h(){return"Map showing location of Giza Pyramids in Greater Cairo, Egypt."},
ga7d(){return"The Giza pyramid complex, also called the Giza necropolis, is the site on the Giza Plateau in Greater Cairo, Egypt that includes the Great Pyramid of Giza, the Pyramid of Khafre, and the Pyramid of Menkaure, along with their associated pyramid complexes and the Great Sphinx of Giza. All were built during the Fourth Dynasty of the Old Kingdom of Ancient Egypt, between 2600 and 2500 BCE."},
ga7e(){return"The pyramids of Giza and others are thought to have been constructed to house the remains of the deceased pharaohs who ruled over Ancient Egypt. A portion of the pharaoh's spirit called his ka was believed to remain with his corpse. Proper care of the remains was necessary in order for the former Pharaoh to perform his new duties as king of the dead."},
ga7b(){return"Most construction theories are based on the idea that the pyramids were built by moving huge stones from a quarry and dragging and lifting them into place. In building the pyramids, the architects might have developed their techniques over time.\nThey would select a site on a relatively flat area of bedrock \u2014 not sand \u2014 which provided a stable foundation. After carefully surveying the site and laying down the first level of stones, they constructed the pyramids in horizontal levels, one on top of the other."},
ga7c(){return"For the Great Pyramid, most of the stone for the interior seems to have been quarried immediately to the south of the construction site. The smooth exterior of the pyramid was made of a fine grade of white limestone that was quarried across the Nile.\nTo ensure that the pyramid remained symmetrical, the exterior casing stones all had to be equal in height and width. Workers might have marked all the blocks to indicate the angle of the pyramid wall and trimmed the surfaces carefully so that the blocks fit together. During construction, the outer surface of the stone was smooth limestone; excess stone has eroded as time has passed."},
ga7f(){return"The site is at the edges of the Western Desert, approximately 5.6 miles (9 km) west of the Nile River in the city of Giza, and about 8 miles (13 km) southwest of the city center of Cairo."},
ga7g(){return"Currently, the pyramids are located in the northwestern side of the Western Desert, and it is considered to be one of the best recognizable and the most visited tourist attractions of the planet."},
ga75(){return"Construction of the 3 pyramids began for three kings of the 4th dynasty; Khufu, Khafre, and Menkaure."},
ga74(){return"Construction began on the smaller surrounding structures called Mastabas for royalty of the 5th and 6th dynasties."},
ga76(){return"Greek Author Herodotus speculated that the pyramids were built in the span of 20 years with over 100,000 slave labourers. This assumption would last for over 1500 years"},
ga71(){return"Tomb of Queen Hetepheres was discovered, containing furniture and jewelry. One of the last remaining treasure-filled tombs after many years of looting and plundering."},
ga72(){return"Designated a UNESCO World Heritage Site to prevent any more unauthorized plundering and vandalism."},
ga73(){return"Discovery of labouror\u2019s districts suggest that the workers building the pyramids were not slaves, and an ingenious building method proved a relatively small work-force was required to build such immense structures."},
